# Клуб любителей почитать
# У нас есть книжный клуб с 50 участниками. Цель клуба состоит в том, чтобы все участники читали
# одну общую книгу в неделю, а затем собирались в клубном помещении, чтобы обсудить содержание книги.
#
# Ни один из участников клуба не является профессиональным читателем книг на полную ставку.
# Поэтому неудивительно, что только меньшинство участников прочитало книгу недели.
#
# Для того чтобы документировать, кто что прочитал, книжный клуб создал небольшую базу данных в
# формате JSON, которая хранится в переменной bookworms в виде json-строки.
#
# Переменная bookworms состоит из списка, содержащего участников книжного клуба. Каждый участник
# представлен объектом (словарем), который содержит информацию об имени участника, его работе и
# книгах, которые он прочитал. Выглядит это следующим образом
#
# {
#   "name": "Thomas Jansson",
#   "occupation": "doctor",
#   "books_read": [
#     "The Lion, the Witch and the Wardrobe",
#     "Heidi",
#     "The Alchemist",
#     "Harry Potter and the Chamber of Secrets"
#   ]
# }
# Книжный клуб нуждается в программе, в которой можно будет вводить несколько книг. Программа
# должна затем отвечать, кто из пользователей прочитал все введенные книги.
#
# Сперва программе на вход поступает целое число n - количество книг, затем в отдельных n
# строках названия книг. Нужно вывести имена участников, которые прочитали все введенные книги.
# Выводить участников нужно в том же порядке, в котором они расположены в переменной bookworms


